const GlobalTitle = styled.h1`
  font-size: 2rem;
  font-weight: 900;
  text-align: center;
  text-transform: uppercase;
  margin: 2.5rem 0 1.5rem 0;
  color: black;
`;

const Title = styled.h1`
    font-size: 2rem;
    font-weight: 900;
    text-align: center;
    text-transform: uppercase;
    margin: 2.5rem;
`;

function MainSecTitleCTA(){
    return <Title>¿A qué esperas? ¡Elige tu regalo!</Title>
};

